import React, { Component, useState, useEffect } from "react";
import { Outlet } from "react-router-dom";
import { withRouter } from "react-router";
import { BrowserRouter, Routes, Route, useLocation } from "react-router-dom";
import { Navigate } from "react-router-dom";
import { Grid, TextField, Box } from "@mui/material";
import UploadImage from "../component/upload_image";
function AddMotorcycle() {
  const handleSubmit = (event) => {
    event.preventDefault();
    var myHeaders = new Headers();
    myHeaders.append("Content-Type", "application/json");

    var raw = JSON.stringify({
      MOTORCYCLE_BALANCE: Balance,
      MOTORCYCLE_PRICE: Price,
      MOTORCYCLE_BRAND: Brand,
      MOTORCYCLE_MODEL: Model,
      MOTORCYCLE_COLOR: Color,
      MOTORCYCLE_REGISTRATION_NUMBER: RegistrationNumber,
      MOTORCYCLE_BUCKET_NUMBER: BucketNumber,
    });

    var requestOptions = {
      method: "POST",
      headers: myHeaders,
      body: raw,
      redirect: "follow",
    };

    fetch("http://localhost:3001/api/v1/motorcycles/", requestOptions)
      .then((response) => response.text())
      .then((result) => console.log(result))
      .catch((error) => console.log("error", error));
  };

  const [RegistrationNumber, setRegistrationNumber] = useState("");
  const [BucketNumber, setBucketNumber] = useState("");
  const [Brand, setBrand] = useState("");
  const [Model, setModel] = useState("");
  const [Color, setColor] = useState("");
  const [Price, setPrice] = useState("");
  const [Balance, setBalance] = useState("");
  return (
    <div>
      <form onSubmit={handleSubmit}>
        <Grid item xs={12} sm={6}>
          <TextField
            id="RegistrationNumber"
            label="เลขทะเบียน"
            variant="outlined"
            fullWidth
            required
            onChange={(e) => setRegistrationNumber(e.target.value)}
          ></TextField>
        </Grid>
        <Grid item xs={12} sm={6}>
          <TextField
            id="BucketNumber"
            label="เลขตัวถัง"
            variant="outlined"
            fullWidth
            required
            onChange={(e) => setBucketNumber(e.target.value)}
          ></TextField>
        </Grid>
        <Grid item xs={12} sm={6}>
          <TextField
            id="Brand"
            label="ยี่ห้อ"
            variant="outlined"
            fullWidth
            required
            onChange={(e) => setBrand(e.target.value)}
          ></TextField>
        </Grid>
        <Grid item xs={12} sm={6}>
          <TextField
            id="Model"
            label="รุ่น"
            variant="outlined"
            fullWidth
            required
            onChange={(e) => setModel(e.target.value)}
          ></TextField>
        </Grid>
        <Grid item xs={12} sm={6}>
          <TextField
            id="Color"
            label="สี"
            variant="outlined"
            fullWidth
            required
            onChange={(e) => setColor(e.target.value)}
          ></TextField>
        </Grid>
        <Grid item xs={12} sm={6}>
          <TextField
            id="Price"
            label="ราคา"
            variant="outlined"
            fullWidth
            required
            onChange={(e) => setPrice(e.target.value)}
          ></TextField>
        </Grid>
        <Grid item xs={12} sm={6}>
          <TextField
            id="Balance"
            label="ยอดคงเหลือ"
            variant="outlined"
            fullWidth
            required
            onChange={(e) => setBalance(e.target.value)}
          ></TextField>
        </Grid>
        <Box
          component="img"
          sx={{
            height: 233,
            width: 350,
            maxHeight: { xs: 233, md: 167 },
            maxWidth: { xs: 350, md: 250 },
          }}
          alt="The house from the offer."
          src="https://images.unsplash.com/photo-1512917774080-9991f1c4c750?auto=format&w=350&dpr=2"
        />

        <UploadImage />
        <button type="submit" variant="contained" class="btn btn-primary mb-3">
          บันทึก
        </button>
      </form>
    </div>
  );
}
export default AddMotorcycle;
